ut można dojść na dworzec autobusowy, kolejowy i prom 🚆🛳️🚍

Ale... 

Jedynym minusem był niesamowity S.M.R.Ó.D 😳

Możliwe, że po prostu trafiliśmy na jakiś zły moment i przy porcie nie śmierdzi tak zazwyczaj 😂 Jednak mimo wszystko dziwiło nas, że ludzie mogą zajadać się jakimiś krewetami w restauracyjnych ogródkach, kiedy my ledwo otwieraliśmy oczy, bo szczypało 😆

Cóż, zjedliśmy tam całkiem dobre lody (oczywiście czekoladowe 🤤, lawendowe odradzam 🤢), kupiliśmy milion magnesów i pamiątek, zwiedziliśmy pałac Dioklecjana i popłynęliśmy parostatkiem w piękny rejs 🚢, ale w sumie... bardziej atrakcyjny był dla nas drugi koniec starówki i kiedy przechadzaliśmy się Rivą, to ok, fajnie, ale chętniej szliśmy oglądać chorwackie koty przy Luka Ice Cream & Cakes 🐈

